import Link from 'next/link';
import { withAmp } from 'next/amp'

export const config = { amp: true };

const linkStyle = {
  marginRight: 15,
  'text-decoration': 'none',
  decoration: 'none',
  color: 'blue'
};

function Header() {
  return (
  <header>
    <style jsx>{`
        @font-face {
            font-family: 'Bai Jamjuree';
            font-style: sans-serif;
            src: url('https://fonts.googleapis.com/css?family=Bai+Jamjuree');
        }
        header {
            font-family: 'Bai Jamjuree', sans-serif;
            width: 100%;
            background-color: #07c1b98a;
            padding: 1vh 0 1vh 0;
            height: 3em;
        }
        .name {
          position: fixed;
          text-align:center;
          left: 50%;
          transform: translateX(-50%);
          font-size: 2em;
          top: 0.5em;
        }
        .links {
          position: relative; 
          top: 1em;
        }
    `}</style>
    <span className="links">
      <Link href="/resume">
        <a style={linkStyle}>Resume</a>
      </Link>
      <Link href="/posts">
        <a style={linkStyle}>Posts</a>
      </Link>
      <Link href="/talks">
        <a style={linkStyle}>Talks</a>
      </Link>
    </span>

    <Link href="/">
      <a style={linkStyle} className="name">Naina Raisinghani</a>
    </Link>

  </header>
)};

export default Header;
